import React, { useState } from "react";
import "./Header2.scss";

const Header = () => {
    const [showNav, setShowNav] = useState(false);

    const toggleNav = () => {
        setShowNav(!showNav);
    };

    return (
        <div className="body">
            <header className="header">
                <nav className={`navb ${showNav ? "show" : ""}`}>
                    <div className="navbar">
                        <div className="nav-logo">Feyman</div>
                        <div className="nav-links">
                            <button className="hamburger" onClick={toggleNav}>
                                <div
                                    className={`bar ${
                                        showNav ? "animate" : ""
                                    }`}
                                ></div>
                                <div
                                    className={`bar ${
                                        showNav ? "animate" : ""
                                    }`}
                                ></div>
                                <div
                                    className={`bar ${
                                        showNav ? "animate" : ""
                                    }`}
                                ></div>
                            </button>
                            <div className="nav-links-options">
                                <ul>
                                    <li>
                                        <a className="atag" href="">
                                            Home
                                        </a>
                                    </li>
                                    <li>
                                        <a className="atag" href="">
                                            Portfolio
                                        </a>
                                    </li>
                                    <li>
                                        <a className="atag" href="">
                                            Services
                                        </a>
                                    </li>
                                </ul>
                            </div>
                            <div className="nav-links-letstalk">Let's Talk</div>
                        </div>
                    </div>
                </nav>
            </header>
        </div>
    );
};

export default Header;
